import React from 'react';
import Navbar from './NavBar';
import './App.css';
import './style.css';



function App() {
  return (
    <>
    <Navbar />
    <div className='containerInto'>
      <div className='row'>
        <div className='col-md-6'>
          <img src='/public/photo-1518655048521-f130df041f66.jpeg' alt='Hello'></img>
        </div>
      </div>
    </div>
    </>
  );
}

export default App;
